{"title":"ElastiFlow (flow): Flows (client/server) - Vega (sankey)","type":"vega","aggs":[],"params":{"spec":"{
  "$schema": "https://vega.github.io/schema/vega/v5.json",
  "description": "Copyright (C)2024 ElastiFlow Inc.",
  "autosize": "fit",

  "config": {
    "text": {
      "fill": "#222222",
      "fontSize": 11
    },
    "axis": {
      "labelColor": "#666666",
      "labelFontSize": 12,
      "domain": false
    }
  },

  "data": [
    {
      "name": "rawData",
      "url": {
        "%context%": true,
        "%timefield%": "@timestamp",
        "index": "elastiflow-flow-codex-*",
        "body": {
          "size": 0,
          "aggs": {
            "table": {
              "composite": {
                "size": 10000,
                "sources": [
                  {
                    "stk1": {
                      "terms": {
                        "field": "flow.client.host.name"
                      }
                    }
                  },
                  {
                    "stk2": {
                      "terms": {
                        "field": "flow.server.l4.port.name"
                      }
                    }
                  },
                  {
                    "stk3": {
                      "terms": {
                        "field": "flow.server.host.name"
                      }
                    }
                  }
                ]
              },
        			"aggs": {
        				"bytes": {
        					"sum": {
        						"field": "flow.bytes"
        					}
        				}
        			}
            }
          }
        }
      },
      "format": {
        "property": "aggregations.table.buckets"
      },
      "transform": [
        {
          "type": "formula",
          "expr": "datum.key.stk1",
          "as": "stk1"
        },
        {
          "type": "formula",
          "expr": "datum.key.stk2",
          "as": "stk2"
        },
        {
          "type": "formula",
          "expr": "datum.key.stk3",
          "as": "stk3"
        },
        {
          "type": "formula",
          "expr": "datum.bytes.value",
          "as": "size"
        }
      ]
    },
    {
      "name": "nodes",
      "source": "rawData",
      "transform": [
        {
          "type": "filter",
          "expr": "!groupSelector || groupSelector.stk1 == datum.stk1 || groupSelector.stk2 == datum.stk2 || groupSelector.stk3 == datum.stk3"
        },
        {
          "type": "formula",
          "expr": "'key1__'+datum.stk1+'__'+datum.stk2+'__'+datum.stk3",
          "as": "key"
        },
        {
          "type": "fold",
          "fields": ["stk1", "stk2", "stk3"],
          "as": ["stack", "grpId"]
        },
        {
          "type": "stack",
          "groupby": ["stack"],
          "sort": {
            "field": "grpId",
            "order": "descending"
          },
          "field": "size"
        },
        {
          "type": "formula",
          "expr": "(datum.y0+datum.y1)/2",
          "as": "yc"
        }
      ]
    },
    {
      "name": "groups",
      "source": "nodes",
      "transform": [
        {
          "type": "aggregate",
          "groupby": ["stack", "grpId"],
          "fields": ["size"],
          "ops": ["sum"],
          "as": ["total"]
        },
        {
          "type": "stack",
          "groupby": ["stack"],
          "sort": {
            "field": "grpId",
            "order": "descending"
          },
          "field": "total"
        },
        {
          "type": "formula",
          "expr": "scale('y', datum.y0)",
          "as": "scaledY0"
        },
        {
          "type": "formula",
          "expr": "scale('y', datum.y1)",
          "as": "scaledY1"
        },
        {
          "type": "formula",
          "expr": "datum.stack == 'stk1'",
          "as": "rightLabel"
        },
        {
          "type": "formula",
          "expr": "datum.total/domain('y')[1]",
          "as": "percentage"
        }
      ]
    },
    {
      "name": "stackedNodes1",
      "source": "nodes",
      "transform": [
        {
          "type": "filter",
          "expr": "datum.stack == 'stk1'"
        }
      ]
    },
    {
      "name": "stackedNodes2",
      "source": "nodes",
      "transform": [
        {
          "type": "filter",
          "expr": "datum.stack == 'stk2'"
        }
      ]
    },
    {
      "name": "stackedNodes3",
      "source": "nodes",
      "transform": [
        {
          "type": "filter",
          "expr": "datum.stack == 'stk3'"
        }
      ]
    },
    {
      "name": "edges1to2",
      "source": "stackedNodes1",
      "transform": [
        {
          "type": "lookup",
          "from": "stackedNodes2",
          "key": "key",
          "fields": ["key"],
          "as": ["target"]
        },
        {
          "type": "linkpath",
          "orient": "horizontal",
          "shape": "diagonal",
          "sourceY": {
            "expr": "scale('y', datum.yc)"
          },
          "sourceX": {
            "expr": "scale('x', 'stk1') + bandwidth('x')"
          },
          "targetY": {
            "expr": "scale('y', datum.target.yc)"
          },
          "targetX": {
            "expr": "scale('x', 'stk2')"
          }
        },
        {
          "type": "formula",
          "expr": "range('y')[0]-scale('y', datum.size)",
          "as": "strokeWidth"
        },
        {
          "type": "formula",
          "expr": "datum.size/domain('y')[1]",
          "as": "percentage"
        }
      ]
    },
    {
      "name": "edges2to3",
      "source": "stackedNodes2",
      "transform": [
        {
          "type": "lookup",
          "from": "stackedNodes3",
          "key": "key",
          "fields": ["key"],
          "as": ["target"]
        },
        {
          "type": "linkpath",
          "orient": "horizontal",
          "shape": "diagonal",
          "sourceY": {
            "expr": "scale('y', datum.yc)"
          },
          "sourceX": {
            "expr": "scale('x', 'stk2') + bandwidth('x')"
          },
          "targetY": {
            "expr": "scale('y', datum.target.yc)"
          },
          "targetX": {
            "expr": "scale('x', 'stk3')"
          }
        },
        {
          "type": "formula",
          "expr": "range('y')[0]-scale('y', datum.size)",
          "as": "strokeWidth"
        },
        {
          "type": "formula",
          "expr": "datum.size/domain('y')[1]",
          "as": "percentage"
        }
      ]
    }
  ],

  "scales": [
    {
      "name": "x",
      "type": "band",
      "range": "width",
      "domain": ["stk1", "stk2", "stk3"],
      "paddingOuter": 0.05,
      "paddingInner": 0.95
    },
    {
      "name": "y",
      "type": "linear",
      "range": "height",
      "domain": {
        "data": "nodes",
        "field": "y1"
      }
    },
    {
      "name": "color",
      "type": "ordinal",
      "range": "category",
      "domain": {
        "data": "rawData",
        "fields": ["stk1", "stk2", "stk3"]
      }
    },
    {
      "name": "stackNames",
      "type": "ordinal",
      "range": ["Client", "Service", "Server"],
      "domain": ["stk1", "stk2", "stk3"]
    }
  ],

  "axes": [
    {
      "orient": "bottom",
      "scale": "x",
      "encode": {
        "labels": {
          "update": {
            "text": {
              "scale": "stackNames",
              "field": "value"
            }
          }
        }
      }
    },
    {
      "orient": "left",
      "scale": "y",
      "encode": {
        "labels": {
          "update": {
            "text": {"signal": "format(datum.value, '.2s') + 'B'"}
          }
        }
      }
    }
  ],

  "marks": [
    {
      "type": "path",
      "name": "edgeMarks1to2",
      "from": {
        "data": "edges1to2"
      },
      "clip": true,
      "encode": {
        "update": {
          "stroke": [
            {
              "test": "groupSelector && groupSelector.stack=='stk1'",
              "scale": "color",
              "field": "stk3"
            },
            {
              "test": "groupSelector && (groupSelector.stack=='stk2' || groupSelector.stack=='stk3')",
              "scale": "color",
              "field": "stk1"
            },
            {
              "scale": "color",
              "field": "stk1"
            }
          ],
          "strokeWidth": {
            "field": "strokeWidth"
          },
          "path": {
            "field": "path"
          },
          "strokeOpacity": {
            "signal": "groupHover.stk1 == datum.stk1 || groupHover.stk2 == datum.stk2 || groupHover.stk3 == datum.stk3 ? 0.9 : 0.3"
          },
          "zindex": {
            "signal": "!groupSelector && (groupHover.stk1 == datum.stk1 || groupHover.stk2 == datum.stk2 || groupHover.stk3 == datum.stk3) ? 1 : 0"
          },
          "tooltip": {
            "signal": "datum.stk1 + '  ' + datum.stk2 + '    ' + format(datum.size, '.2s') + 'B (' + format(datum.percentage, '.1%') + ')'"
          }
        },
        "hover": {
          "strokeOpacity": {
            "value": 1
          }
        }
      }
    },
    {
      "type": "path",
      "name": "edgeMarks2to3",
      "from": {
        "data": "edges2to3"
      },
      "clip": true,
      "encode": {
        "update": {
          "stroke": [
            {
              "test": "groupSelector && groupSelector.stack=='stk1'",
              "scale": "color",
              "field": "stk3"
            },
            {
              "test": "groupSelector && (groupSelector.stack=='stk2' || groupSelector.stack=='stk3')",
              "scale": "color",
              "field": "stk1"
            },
            {
              "scale": "color",
              "field": "stk2"
            }
          ],
          "strokeWidth": {
            "field": "strokeWidth"
          },
          "path": {
            "field": "path"
          },
          "strokeOpacity": {
            "signal": "groupHover.stk1 == datum.stk1 || groupHover.stk2 == datum.stk2 || groupHover.stk3 == datum.stk3 ? 0.9 : 0.3"
          },
          "zindex": {
            "signal": "!groupSelector && (groupHover.stk1 == datum.stk1 || groupHover.stk2 == datum.stk2 || groupHover.stk3 == datum.stk3) ? 1 : 0"
          },
          "tooltip": {
            "signal": "datum.stk2 + '  ' + datum.stk3 + '    ' + format(datum.size, '.2s') + 'B (' + format(datum.percentage, '.1%') + ')'"
          }
        },
        "hover": {
          "strokeOpacity": {
            "value": 1
          }
        }
      }
    },
    {
      "type": "rect",
      "name": "groupMark",
      "from": {
        "data": "groups"
      },
      "encode": {
        "enter": {
          "fill": {
            "scale": "color",
            "field": "grpId"
          },
          "width": {
            "scale": "x",
            "band": 1
          }
        },
        "update": {
          "x": {
            "scale": "x",
            "field": "stack"
          },
          "y": {
            "field": "scaledY0"
          },
          "y2": {
            "field": "scaledY1"
          },
          "fillOpacity": {
            "value": 0.6
          },
          "tooltip": {
            "signal": "datum.grpId + '    ' + format(datum.total, '.2s') + 'B (' + format(datum.percentage, '.1%') + ')'"
          }
        },
        "hover": {
          "fillOpacity": {
            "value": 1
          }
        }
      }
    },
    {
      "type": "text",
      "from": {
        "data": "groups"
      },
      "interactive": false,
      "encode": {
        "update": {
          "x": {
            "signal": "scale('x', datum.stack) + (datum.rightLabel ? bandwidth('x') + 8 : -8)"
          },
          "yc": {
            "signal": "(datum.scaledY0 + datum.scaledY1)/2"
          },
          "align": {
            "signal": "datum.rightLabel ? 'left' : 'right'"
          },
          "baseline": {
            "value": "middle"
          },
          "fontWeight": {
            "value": "bold"
          },
          "text": {
            "signal": "abs(datum.scaledY0-datum.scaledY1) > 11 ? datum.grpId : ''"
          }
        }
      }
    },
    {
      "type": "group",
      "data": [
        {
          "name": "dataForShowAll",
          "values": [{}],
          "transform": [
            {
              "type": "filter",
              "expr": "groupSelector"
            }
          ]
        }
      ],
      "encode": {
        "enter": {
          "xc": {
            "signal": "width/2"
          },
          "y": {
            "value": 30
          },
          "width": {
            "value": 80
          },
          "height": {
            "value": 30
          }
        }
      },
      "marks": [
        {
          "type": "group",
          "name": "groupReset",
          "from": {
            "data": "dataForShowAll"
          },
          "encode": {
            "enter": {
              "cornerRadius": {
                "value": 6
              },
              "fill": {
                "value": "#F5F7FA"
              },
              "stroke": {
                "value": "#c1c1c1"
              },
              "strokeWidth": {
                "value": 2
              },
              "height": {
                "field": {
                  "group": "height"
                }
              },
              "width": {
                "field": {
                  "group": "width"
                }
              }
            },
            "update": {
              "opacity": {
                "value": 1
              }
            },
            "hover": {
              "opacity": {
                "value": 0.7
              }
            }
          },
          "marks": [
            {
              "type": "text",
              "interactive": false,
              "encode": {
                "enter": {
                  "xc": {
                    "field": {
                      "group": "width"
                    },
                    "mult": 0.5
                  },
                  "yc": {
                    "field": {
                      "group": "height"
                    },
                    "mult": 0.5,
                    "offset": 2
                  },
                  "align": {
                    "value": "center"
                  },
                  "baseline": {
                    "value": "middle"
                  },
                  "fontWeight": {
                    "value": "bold"
                  },
                  "text": {
                    "value": "Show All"
                  }
                }
              }
            }
          ]
        }
      ]
    }
  ],

  "signals": [
    {
      "name": "groupHover",
      "value": {},
      "on": [
        {
          "events": "@groupMark:mouseover",
          "update": "{stk1:datum.stack=='stk1' && datum.grpId, stk2:datum.stack=='stk2' && datum.grpId, stk3: datum.stack == 'stk3' && datum.grpId}"
        },
        {
          "events": "mouseout",
          "update": "{}"
        }
      ]
    },
    {
      "name": "groupSelector",
      "value": false,
      "on": [
        {
          "events": "@groupMark:click!",
          "update": "{stack:datum.stack, stk1:datum.stack=='stk1' && datum.grpId, stk2:datum.stack=='stk2' && datum.grpId, stk3: datum.stack == 'stk3' && datum.grpId}"
        },
        {
          "events": [
            {
              "type": "click",
              "markname": "groupReset"
            },
            {
              "type": "dblclick"
            }
          ],
          "update": "false"
        }
      ]
    }
  ]
}"}}

