          "from": "stackedNodes4",
          "key": "key",
          "fields": ["key"],
          "as": ["target"]
        },
        {
          "type": "linkpath",
          "orient": "horizontal",
          "shape": "diagonal",
          "sourceY": {
            "expr": "scale('y', datum.yc)"
          },
          "sourceX": {
            "expr": "scale('x', 'stk3') + bandwidth('x')"
          },
          "targetY": {
            "expr": "scale('y', datum.target.yc)"
          },
          "targetX": {
            "expr": "scale('x', 'stk4')"
          }
        },
        {
          "type": "formula",
          "expr": "range('y')[0]-scale('y', datum.size)",
          "as": "strokeWidth"
        },
        {
          "type": "formula",
          "expr": "datum.size/domain('y')[1]",
          "as": "percentage"
        }
      ]
    }
  ],

  "scales": [
    {
      "name": "x",
      "type": "band",
      "range": "width",
      "domain": ["stk1", "stk2", "stk3", "stk4"],
      "paddingOuter": 0.05,
      "paddingInner": 0.95
    },
    {
      "name": "y",
      "type": "linear",
      "range": "height",
      "domain": {
        "data": "nodes",
        "field": "y1"
      }
    },
    {
      "name": "color",
      "type": "ordinal",
      "range": "category",
      "domain": {
        "data": "rawData",
        "fields": ["stk1", "stk2", "stk3", "stk4"]
      }
    },
    {
      "name": "stackNames",
      "type": "ordinal",
      "range": ["Client", "Application", "Service", "Server"],
      "domain": ["stk1", "stk2", "stk3", "stk4"]
    }
  ],

  "axes": [
    {
      "orient": "bottom",
      "scale": "x",
      "encode": {
        "labels": {
          "update": {
            "text": {
              "scale": "stackNames",
              "field": "value"
            }
          }
        }
      }
    },
    {
      "orient": "left",
      "scale": "y",
      "encode": {
        "labels": {
          "update": {
            "text": {"signal": "format(datum.value, '.2s') + 'B'"}
          }
        }
      }
    }
  ],

  "marks": [
    {
      "type": "path",
      "name": "edgeMarks1to2",
      "from": {
        "data": "edges1to2"
      },
      "clip": true,
      "encode": {
        "update": {
          "stroke": [
            {
              "test": "groupSelector && groupSelector.stack=='stk1'",
              "scale": "color",
              "field": "stk4"
            },
            {
              "test": "groupSelector && (groupSelector.stack=='stk2' || groupSelector.stack=='stk3' || groupSelector.stack=='stk4')",
              "scale": "color",
              "field": "stk1"
            },
            {
              "scale": "color",
              "field": "stk1"
            }
          ],
          "strokeWidth": {
            "field": "strokeWidth"
          },
          "path": {
            "field": "path"
          },
          "strokeOpacity": {
            "signal": "groupHover.stk1 == datum.stk1 || groupHover.stk2 == datum.stk2 || groupHover.stk3 == datum.stk3 || groupHover.stk4 == datum.stk4 ? 0.9 : 0.3"
          },
          "zindex": {
            "signal": "!groupSelector && (groupHover.stk1 == datum.stk1 || groupHover.stk2 == datum.stk2 || groupHover.stk3 == datum.stk3 || groupHover.stk4 == datum.stk4) ? 1 : 0"
          },
          "tooltip": {
            "signal": "datum.stk1 + '  ' + datum.stk2 + '    ' + format(datum.size, '.2s') + 'B (' + format(datum.percentage, '.1%') + ')'"
          }
        },
        "hover": {
          "strokeOpacity": {
            "value": 1
          }
        }
      }
    },
    {
      "type": "path",
      "name": "edgeMarks2to3",
      "from": {
        "data": "edges2to3"
      },
      "clip": true,
      "encode": {
        "update": {
          "stroke": [
            {
              "test": "groupSelector && groupSelector.stack=='stk1'",
              "scale": "color",
              "field": "stk4"
            },
            {
              "test": "groupSelector && (groupSelector.stack=='stk2' || groupSelector.stack=='stk3' || groupSelector.stack=='stk4')",
              "scale": "color",
              "field": "stk1"
            },
            {
              "scale": "color",
              "field": "stk2"
            }
          ],
          "strokeWidth": {
            "field": "strokeWidth"
          },
          "path": {
            "field": "path"
          },
          "strokeOpacity": {
            "signal": "groupHover.stk1 == datum.stk1 || groupHover.stk2 == datum.stk2 || groupHover.stk3 == datum.stk3 || groupHover.stk4 == datum.stk4 ? 0.9 : 0.3"
          },
          "zindex": {
            "signal": "!groupSelector && (groupHover.stk1 == datum.stk1 || groupHover.stk2 == datum.stk2 || groupHover.stk3 == datum.stk3 || groupHover.stk4 == datum.stk4) ? 1 : 0"
          },
          "tooltip": {
            "signal": "datum.stk2 + '  ' + datum.stk3 + '    ' + format(datum.size, '.2s') + 'B (' + format(datum.percentage, '.1%') + ')'"
          }
        },
        "hover": {
          "strokeOpacity": {
            "value": 1
          }
        }
      }
    },
    {
      "type": "path",
      "name": "edgeMarks3to4",
      "from": {
        "data": "edges3to4"
      },
      "clip": true,
      "encode": {
        "update": {
          "stroke": [
            {
              "test": "groupSelector && groupSelector.stack=='stk1'",
              "scale": "color",
              "field": "stk4"
            },
            {
              "test": "groupSelector && (groupSelector.stack=='stk2' || groupSelector.stack=='stk3' || groupSelector.stack=='stk4')",
              "scale": "color",
              "field": "stk1"
            },
            {
              "scale": "color",
              "field": "stk3"
            }
          ],
          "strokeWidth": {
            "field": "strokeWidth"
          },
          "path": {
            "field": "path"
          },
          "strokeOpacity": {
            "signal": "groupHover.stk1 == datum.stk1 || groupHover.stk2 == datum.stk2 || groupHover.stk3 == datum.stk3 || groupHover.stk4 == datum.stk4 ? 0.9 : 0.3"
          },
          "zindex": {
            "signal": "!groupSelector && (groupHover.stk1 == datum.stk1 || groupHover.stk2 == datum.stk2 || groupHover.stk3 == datum.stk3 || groupHover.stk4 == datum.stk4) ? 1 : 0"
          },
          "tooltip": {
            "signal": "datum.stk3 + '  ' + datum.stk4 + '    ' + format(datum.size, '.2s') + 'B (' + format(datum.percentage, '.1%') + ')'"
          }
        },
        "hover": {
          "strokeOpacity": {
            "value": 1
          }
        }
      }
    },
    {
      "type": "rect",
      "name": "groupMark",
      "from": {
        "data": "groups"
      },
      "encode": {
        "enter": {
          "fill": {
            "scale": "color",
            "field": "grpId"
          },
          "width": {
            "scale": "x",
            "band": 1
          }
        },
        "update": {
          "x": {
            "scale": "x",
            "field": "stack"
          },
          "y": {
            "field": "scaledY0"
          },
          "y2": {
            "field": "scaledY1"
          },
          "fillOpacity": {
            "value": 0.6
          },
          "tooltip": {
            "signal": "datum.grpId + '    ' + format(datum.total, '.2s') + 'B (' + format(datum.percentage, '.1%') + ')'"
          }
        },
        "hover": {
          "fillOpacity": {
            "value": 1
          }
        }
      }
    },
    {
      "type": "text",
      "from": {
        "data": "groups"
      },
      "interactive": false,
      "encode": {
        "update": {
          "x": {
            "signal": "scale('x', datum.stack) + (datum.rightLabel ? bandwidth('x') + 8 : -8)"
          },
          "yc": {
            "signal": "(datum.scaledY0 + datum.scaledY1)/2"
          },
          "align": {
            "signal": "datum.rightLabel ? 'left' : 'right'"
          },
          "baseline": {
            "value": "middle"
          },
          "fontWeight": {
            "value": "bold"
          },
          "text": {
            "signal": "abs(datum.scaledY0-datum.scaledY1) > 11 ? datum.grpId : ''"
          }
        }
      }
    },
    {
      "type": "group",
      "data": [
        {
          "name": "dataForShowAll",
          "values": [{}],
          "transform": [
            {
              "type": "filter",
              "expr": "groupSelector"
            }
          ]
        }
      ],
      "encode": {
        "enter": {
          "xc": {
            "signal": "width/2"
          },
          "y": {
            "value": 30
          },
          "width": {
            "value": 80
          },
          "height": {
            "value": 30
          }
        }
      },
      "marks": [
        {
          "type": "group",
          "name": "groupReset",
          "from": {
            "data": "dataForShowAll"
          },
          "encode": {
            "enter": {
              "cornerRadius": {
                "value": 6
              },
              "fill": {
                "value": "#F5F7FA"
              },
              "stroke": {
                "value": "#c1c1c1"
              },
              "strokeWidth": {
                "value": 2
              },
              "height": {
                "field": {
                  "group": "height"
                }
              },
              "width": {
                "field": {
                  "group": "width"
                }
              }
            },
            "update": {
              "opacity": {
                "value": 1
              }
            },
            "hover": {
              "opacity": {
                "value": 0.7
              }
            }
          },
          "marks": [
            {
              "type": "text",
              "interactive": false,
              "encode": {
                "enter": {
                  "xc": {
                    "field": {
                      "group": "width"
                    },
                    "mult": 0.5
                  },
                  "yc": {
                    "field": {
                      "group": "height"
                    },
                    "mult": 0.5,
                    "offset": 2
                  },
                  "align": {
                    "value": "center"
                  },
                  "baseline": {
                    "value": "middle"
                  },
                  "fontWeight": {
                    "value": "bold"
                  },
                  "text": {
                    "value": "Show All"
                  }
                }
              }
            }
          ]
        }
      ]
    }
  ],

  "signals": [
    {
      "name": "groupHover",
      "value": {},
      "on": [
        {
          "events": "@groupMark:mouseover",
          "update": "{stk1:datum.stack=='stk1' && datum.grpId, stk2:datum.stack=='stk2' && datum.grpId, stk3: datum.stack == 'stk3' && datum.grpId, stk4: datum.stack == 'stk4' && datum.grpId}"
        },
        {
          "events": "mouseout",
          "update": "{}"
        }
      ]
    },
    {
      "name": "groupSelector",
      "value": false,
      "on": [
        {
          "events": "@groupMark:click!",
          "update": "{stack:datum.stack, stk1:datum.stack=='stk1' && datum.grpId, stk2:datum.stack=='stk2' && datum.grpId, stk3: datum.stack == 'stk3' && datum.grpId, stk4: datum.stack == 'stk4' && datum.grpId}"
        },
        {
          "events": [
            {
              "type": "click",
              "markname": "groupReset"
            },
            {
              "type": "dblclick"
            }
          ],
          "update": "false"
        }
      ]
    }
  ]
}"}}

{"title":"ElastiFlow: Flows (src/dst) - Vega (directed graph)","type":"vega","aggs":[],"params":{"spec":"{
  "$schema": "https://vega.github.io/schema/vega/v5.json",
  "description": "Copyright (C)2022 ElastiFlow Inc.",
  "autosize": "fit",

  "data": [
    {
      "name": "flows",
      "url": {
        "%context%": true,
        "%timefield%": "@timestamp",
        "index": "elastiflow-flow-codex-*",
        "body": {
          "size": 0,
          "aggs": {
            "table": {
              "composite": {
                "size": 384,
                "sources": [{
                    "client": {
                      "terms": {
                        "field": "flow.src.host.name"
                      }
                    }
                  },
                  {
                    "server": {
                      "terms": {
                        "field": "flow.dst.host.name"
                      }
                    }
                  }
                ]
              },
              "aggs": {
                "flow_bytes": {
                  "sum": {
                    "field": "flow.bytes"
                  }
                },
                "flow_packets": {
                  "sum": {
                    "field": "flow.packets"
                  }
                }
              }
            }
          }
        }
      },
      "format": {
        "property": "aggregations.table.buckets"
      },
      "transform": [
        {
          "type": "formula",
          "expr": "datum.key.client",
          "as": "source"
        },
        {
          "type": "formula",
          "expr": "datum.key.server",
          "as": "target"
        },
        {
          "type": "formula",
          "expr": "datum.flow_bytes.value",
          "as": "bytes"
        },
        {
          "type": "formula",
          "expr": "datum.flow_packets.value",
          "as": "packets"
        }
      ]
    },

    {
      "name": "endpoints",
      "source": "flows",
      "transform": [
        {
          "type": "fold",
          "fields": ["source", "target"],
          "as": ["stack", "key"]
        },
        {
          "type": "aggregate",
          "groupby": ["key"],
          "fields": ["doc_count", "bytes", "packets"],
          "ops": ["sum", "sum", "sum"],
          "as": ["doc_count", "bytes", "packets"]
        }
      ]
    },

    {
      "name": "traffic",
      "source": "flows",
      "transform": [
        {
          "type": "aggregate",
          "groupby": ["source", "target"],
          "fields": ["doc_count", "bytes", "packets"],
          "ops": ["sum", "sum", "sum"],
          "as": ["doc_count", "bytes", "packets"]
        }
      ]
    }
  ],

  "scales": [
    {
      "name": "endpointBytesScale",
      "type": "quantile",
      "domain": {"data": "endpoints", "field": "bytes"},
      "range": [128,192,256,320,384,448,512,576,640,768,896,1024]
    },
    {
      "name": "fontsizeEndpointBytesScale",
      "type": "quantile",
      "domain": {"data": "endpoints", "field": "bytes"},
      "range": [0,0,0,0,0,0,0,12]
    },
    {
      "name": "colorEndpointsBytesBlues",
      "type": "quantile",
      "domain": {"data": "endpoints", "field": "bytes"},
      "range": ["#99ddff", "#80d4ff", "#66ccff", "#33bbff", "#00aaff", "#0099e6"]
    },
    {
      "name": "colorEndpointsBytesLightBlues",
      "type": "quantile",
      "domain": {"data": "endpoints", "field": "bytes"},
      "range": ["#e6f7ff", "#cceeff", "#b3e6ff", "#99ddff"]
    },
    {
      "name": "trafficBytesScale",
      "type": "quantile",
      "domain": {"data": "traffic", "field": "bytes"},
      "range": [1,2,3,4,6,8]
    },
    {
      "name": "colorTrafficBytesGreys",
      "type": "quantile",
      "domain": {"data": "traffic", "field": "bytes"},
      "range": ["#ddd", "#ccc", "#bbb", "#aaa", "#999", "#888"]
    }
  ],

  "signals": [
    {
      "name": "cx",
      "update": "width / 2"
    },
    {
      "name": "cy",
      "update": "height / 2"
    },
    {
      "name": "nodeCharge",
      "value": -128,
      "bind": {"input": "range", "min": -200, "max": 10, "step": 1}
    },
    {
      "name": "linkDistance",
      "value": 18,
      "bind": {"input": "range", "min": 8, "max": 64, "step": 1}
    },
    {
      "name": "decay",
      "value": 0.5,
      "bind": {"input": "range", "min": 0, "max": 1, "step": 0.01}
    },
    {
      "name": "gravityX",
      "value": 0.1,
      "bind": {"input": "range", "min": 0, "max": 1}
    },
    {
      "name": "gravityY",
      "value": 0.2,
      "bind": {"input": "range", "min": 0, "max": 1}
    },
    {
      "name": "static",
      "value": false,
      "bind": {"input": "checkbox"}
    },
    {
      "name": "fix",
      "value": false,
      "on": [
        {
          "events": "symbol:mouseout[!event.buttons], window:mouseup",
          "update": "false"
        },
        {
          "events": "symbol:mouseover",
          "update": "fix || true"
        },
        {
          "events": "[symbol:mousedown, window:mouseup] > window:mousemove!",
          "update": "xy()",
          "force": true
        }
      ]
    },
    {
      "name": "node",
      "value": null,
      "on": [
        {
          "events": "symbol:mouseover",
          "update": "fix === true ? item() : node"
        }
      ]
    },
    {
      "name": "restart",
      "value": false,
      "on": [
        {
          "events": {"signal": "fix"}, "update": "fix && fix.length"
        }
      ]
    }
  ],

  "marks": [
    {
      "name": "nodes",
      "type": "symbol",
      "zindex": 1,
      "from": {"data": "endpoints"},
      "on": [
        {
          "trigger": "fix",
          "modify": "node",
          "values": "fix === true ? {fx: node.x, fy: node.y} : {fx: fix[0], fy: fix[1]}"
        },
        {"trigger": "!fix", "modify": "node", "values": "{fx: null, fy: null}"}
      ],
      "encode": {
        "enter": {
          "fill": {"scale": "colorEndpointsBytesBlues", "field": "bytes"},
          "stroke": {"scale": "colorEndpointsBytesLightBlues", "field": "bytes"},
          "xfocus": {"signal": "cx"},
          "yfocus": {"signal": "cy"}
        },
        "update": {
          "size": {"scale": "endpointBytesScale", "field": "bytes"},
          "cursor": {"value": "pointer"}
        },
        "hover": {
          "tooltip": {
            "signal": "datum.key + ' (Bytes: ' + format(datum.bytes, '.2s') + ', Packets: ' + datum.packets + ', Records: ' + datum.doc_count + ')'"
          }
        }
      },
      "transform": [
        {
          "type": "force",
          "iterations": 160,
          "velocityDecay": {
            "signal": "decay"
          },
          "restart": {"signal": "restart"},
          "static": {"signal": "static"},
          "signal": "force",
          "forces": [
            {"force": "center", "x": {"signal": "cx"}, "y": {"signal": "cy"}},
            {"force": "x", "x": "xfocus", "strength": {"signal": "gravityX"}},
            {"force": "y", "y": "yfocus", "strength": {"signal": "gravityY"}},
            {"force": "collide", "radius": {"signal": "linkDistance"}},
            {"force": "nbody", "strength": {"signal": "nodeCharge"}},
            {"force": "link", "links": "traffic", "id": "datum.key", "distance": {"signal": "linkDistance"}}
          ]
        }
      ]
    },
    {
      "type": "text",
      "zindex": 2,
      "from": {"data": "nodes"},
      "interactive": false,
      "encode": {
        "enter": {
          "fill": {"value": "black"},
          "fontSize": {"scale": "fontsizeEndpointBytesScale", "field": "datum.bytes"}
        },
        "update": {
          "y": {"field": "y", "offset": {"signal": "sqrt(datum.size/2) * 1.3"}},
          "x": {"field": "x"},
          "text": {"field": "datum.key"},
          "align": {"value": "center"}
        }
      }
    },
    {
      "name": "paths",
      "type": "path",
      "from": {"data": "traffic"},
      "interactive": true,
      "encode": {
        "update": {
          "stroke": {"scale": "colorTrafficBytesGreys", "field": "bytes"},
          "strokeWidth": {"scale": "trafficBytesScale", "field": "bytes"}
        },
        "hover": {
          "tooltip": {
            "signal": "'Bytes: ' + format(datum.bytes, '.2s') + ', Packets: ' + datum.packets + ', Records: ' + datum.doc_count"
          }
        }
      },
      "transform": [
        {
          "type": "linkpath",
          "require": {"signal": "force"},
          "shape": "curve",
          "sourceX": "datum.source.x",
          "sourceY": "datum.source.y",
          "targetX": "datum.target.x",
          "targetY": "datum.target.y"
        }
      ]
    }
  ]
}
"}}

