  "$schema": "https://vega.github.io/schema/vega/v5.json",
  "description": "Copyright (C)2022 ElastiFlow Inc.",
  "autosize": "fit",

  "data": [
    {
      "name": "flows",
      "url": {
        "%context%": true,
        "%timefield%": "@timestamp",
        "index": "elastiflow-path-codex-*",
        "body": {
          "size": 0,
          "aggs": {
            "table": {
              "composite": {
                "size": 384,
                "sources": [{
                    "client": {
                      "terms": {
                        "field": "flow.src.host.name"
                      }
                    }
                  },
                  {
                    "server": {
                      "terms": {
                        "field": "flow.dst.host.name"
                      }
                    }
                  }
                ]
              },
              "aggs": {
                "flow_bytes": {
                  "sum": {
                    "field": "flow.bytes"
                  }
                },
                "flow_packets": {
                  "sum": {
                    "field": "flow.packets"
                  }
                }
              }
            }
          }
        }
      },
      "format": {
        "property": "aggregations.table.buckets"
      },
      "transform": [
        {
          "type": "formula",
          "expr": "datum.key.client",
          "as": "source"
        },
        {
          "type": "formula",
          "expr": "datum.key.server",
          "as": "target"
        },
        {
          "type": "formula",
          "expr": "datum.flow_bytes.value",
          "as": "bytes"
        },
        {
          "type": "formula",
          "expr": "datum.flow_packets.value",
          "as": "packets"
        }
      ]
    },

    {
      "name": "endpoints",
      "source": "flows",
      "transform": [
        {
          "type": "fold",
          "fields": ["source", "target"],
          "as": ["stack", "key"]
        },
        {
          "type": "aggregate",
          "groupby": ["key"],
          "fields": ["doc_count", "bytes", "packets"],
          "ops": ["sum", "sum", "sum"],
          "as": ["doc_count", "bytes", "packets"]
        }
      ]
    },

    {
      "name": "traffic",
      "source": "flows",
      "transform": [
        {
          "type": "aggregate",
          "groupby": ["source", "target"],
          "fields": ["doc_count", "bytes", "packets"],
          "ops": ["sum", "sum", "sum"],
          "as": ["doc_count", "bytes", "packets"]
        }
      ]
    }
  ],

  "scales": [
    {
      "name": "endpointBytesScale",
      "type": "quantile",
      "domain": {"data": "endpoints", "field": "bytes"},
      "range": [128,192,256,320,384,448,512,576,640,768,896,1024]
    },
    {
      "name": "fontsizeEndpointBytesScale",
      "type": "quantile",
      "domain": {"data": "endpoints", "field": "bytes"},
      "range": [0,0,0,0,0,0,0,12]
    },
    {
      "name": "colorEndpointsBytesBlues",
      "type": "quantile",
      "domain": {"data": "endpoints", "field": "bytes"},
      "range": ["#99ddff", "#80d4ff", "#66ccff", "#33bbff", "#00aaff", "#0099e6"]
    },
    {
      "name": "colorEndpointsBytesLightBlues",
      "type": "quantile",
      "domain": {"data": "endpoints", "field": "bytes"},
      "range": ["#e6f7ff", "#cceeff", "#b3e6ff", "#99ddff"]
    },
    {
      "name": "trafficBytesScale",
      "type": "quantile",
      "domain": {"data": "traffic", "field": "bytes"},
      "range": [1,2,3,4,6,8]
    },
    {
      "name": "colorTrafficBytesGreys",
      "type": "quantile",
      "domain": {"data": "traffic", "field": "bytes"},
      "range": ["#ddd", "#ccc", "#bbb", "#aaa", "#999", "#888"]
    }
  ],

  "signals": [
    {
      "name": "cx",
      "update": "width / 2"
    },
    {
      "name": "cy",
      "update": "height / 2"
    },
    {
      "name": "nodeCharge",
      "value": -128,
      "bind": {"input": "range", "min": -200, "max": 10, "step": 1}
    },
    {
      "name": "linkDistance",
      "value": 24,
      "bind": {"input": "range", "min": 8, "max": 64, "step": 1}
    },
    {
      "name": "decay",
      "value": 0.7,
      "bind": {"input": "range", "min": 0, "max": 1, "step": 0.01}
    },
    {
      "name": "gravityX",
      "value": 0.1,
      "bind": {"input": "range", "min": 0, "max": 1}
    },
    {
      "name": "gravityY",
      "value": 0.2,
      "bind": {"input": "range", "min": 0, "max": 1}
    },
    {
      "name": "static",
      "value": false,
      "bind": {"input": "checkbox"}
    },
    {
      "name": "fix",
      "value": false,
      "on": [
        {
          "events": "symbol:mouseout[!event.buttons], window:mouseup",
          "update": "false"
        },
        {
          "events": "symbol:mouseover",
          "update": "fix || true"
        },
        {
          "events": "[symbol:mousedown, window:mouseup] > window:mousemove!",
          "update": "xy()",
          "force": true
        }
      ]
    },
    {
      "name": "node",
      "value": null,
      "on": [
        {
          "events": "symbol:mouseover",
          "update": "fix === true ? item() : node"
        }
      ]
    },
    {
      "name": "restart",
      "value": false,
      "on": [
        {
          "events": {"signal": "fix"}, "update": "fix && fix.length"
        }
      ]
    }
  ],

  "marks": [
    {
      "name": "nodes",
      "type": "symbol",
      "zindex": 1,
      "from": {"data": "endpoints"},
      "on": [
        {
          "trigger": "fix",
          "modify": "node",
          "values": "fix === true ? {fx: node.x, fy: node.y} : {fx: fix[0], fy: fix[1]}"
        },
        {"trigger": "!fix", "modify": "node", "values": "{fx: null, fy: null}"}
      ],
      "encode": {
        "enter": {
          "fill": {"scale": "colorEndpointsBytesBlues", "field": "bytes"},
          "stroke": {"scale": "colorEndpointsBytesLightBlues", "field": "bytes"},
          "xfocus": {"signal": "cx"},
          "yfocus": {"signal": "cy"}
        },
        "update": {
          "size": {"scale": "endpointBytesScale", "field": "bytes"},
          "cursor": {"value": "pointer"}
        },
        "hover": {
          "tooltip": {
            "signal": "datum.key + ' (Bytes: ' + format(datum.bytes, '.2s') + ', Packets: ' + datum.packets + ', Records: ' + datum.doc_count + ')'"
          }
        }
      },
      "transform": [
        {
          "type": "force",
          "iterations": 160,
          "velocityDecay": {
            "signal": "decay"
          },
          "restart": {"signal": "restart"},
          "static": {"signal": "static"},
          "signal": "force",
          "forces": [
            {"force": "center", "x": {"signal": "cx"}, "y": {"signal": "cy"}},
            {"force": "x", "x": "xfocus", "strength": {"signal": "gravityX"}},
            {"force": "y", "y": "yfocus", "strength": {"signal": "gravityY"}},
            {"force": "collide", "radius": {"signal": "linkDistance"}},
            {"force": "nbody", "strength": {"signal": "nodeCharge"}},
            {"force": "link", "links": "traffic", "id": "datum.key", "distance": {"signal": "linkDistance"}}
          ]
        }
      ]
    },
    {
      "type": "text",
      "zindex": 2,
      "from": {"data": "nodes"},
      "interactive": false,
      "encode": {
        "enter": {
          "fill": {"value": "black"},
          "fontSize": {"scale": "fontsizeEndpointBytesScale", "field": "datum.bytes"}
        },
        "update": {
          "y": {"field": "y", "offset": {"signal": "sqrt(datum.size/2) * 1.3"}},
          "x": {"field": "x"},
          "text": {"field": "datum.key"},
          "align": {"value": "center"}
        }
      }
    },
    {
      "name": "paths",
      "type": "path",
      "from": {"data": "traffic"},
      "interactive": true,
      "encode": {
        "update": {
          "stroke": {"scale": "colorTrafficBytesGreys", "field": "bytes"},
          "strokeWidth": {"scale": "trafficBytesScale", "field": "bytes"}
        },
        "hover": {
          "tooltip": {
            "signal": "'Bytes: ' + format(datum.bytes, '.2s') + ', Packets: ' + datum.packets + ', Records: ' + datum.doc_count"
          }
        }
      },
      "transform": [
        {
          "type": "linkpath",
          "require": {"signal": "force"},
          "shape": "curve",
          "sourceX": "datum.source.x",
          "sourceY": "datum.source.y",
          "targetX": "datum.target.x",
          "targetY": "datum.target.y"
        }
      ]
    }
  ]
}
"}}

{"title":"ElastiFlow: Flows (client AS/server AS) - Vega (sankey)","type":"vega","aggs":[],"params":{"spec":"{
  "$schema": "https://vega.github.io/schema/vega/v3.0.json",
  "data": [
    {
      "name": "rawData",
      "url": {
        "%context%": true,
        "%timefield%": "@timestamp",
        "index": "elastiflow-*",
        "body": {
          "size": 0,
          "aggs": {
            "table": {
              "composite": {
                "size": 1000,
                "sources": [
                  {"stk1": {"terms": {"field": "flow.client.as.label"}}},
                  {"stk2": {"terms": {"field": "flow.server.as.label"}}}
                ]
              },
        			"aggs": {
        				"bytes": {
        					"sum": {
        						"field": "flow.bytes"
        					}
        				}
        			}
            }
          }
        }
      },
      "format": {"property": "aggregations.table.buckets"},
      "transform": [
        {"type": "formula", "expr": "datum.key.stk1", "as": "stk1"},
        {"type": "formula", "expr": "datum.key.stk2", "as": "stk2"},
        {"type": "formula", "expr": "datum.bytes.value", "as": "size"}
      ]
    },
    {
      "name": "nodes",
      "source": "rawData",
      "transform": [
        {
          "type": "filter",
          "expr": "!groupSelector || groupSelector.stk1 == datum.stk1 || groupSelector.stk2 == datum.stk2"
        },
        {"type": "formula", "expr": "datum.stk1+datum.stk2", "as": "key"},
        {"type": "fold", "fields": ["stk1", "stk2"], "as": ["stack", "grpId"]},
        {
          "type": "formula",
          "expr": "datum.stack == 'stk1' ? datum.stk1+datum.stk2 : datum.stk2+datum.stk1",
          "as": "sortField"
        },
        {
          "type": "stack",
          "groupby": ["stack"],
          "sort": {"field": "sortField", "order": "descending"},
          "field": "size"
        },
        {"type": "formula", "expr": "(datum.y0+datum.y1)/2", "as": "yc"}
      ]
    },
    {
      "name": "groups",
      "source": "nodes",
      "transform": [
        {
          "type": "aggregate",
          "groupby": ["stack", "grpId"],
          "fields": ["size"],
          "ops": ["sum"],
          "as": ["total"]
        },
        {
          "type": "stack",
          "groupby": ["stack"],
          "sort": {"field": "grpId", "order": "descending"},
          "field": "total"
        },
        {"type": "formula", "expr": "scale('y', datum.y0)", "as": "scaledY0"},
        {"type": "formula", "expr": "scale('y', datum.y1)", "as": "scaledY1"},
        {"type": "formula", "expr": "datum.stack == 'stk1'", "as": "rightLabel"},
        {
          "type": "formula",
          "expr": "datum.total/domain('y')[1]",
          "as": "percentage"
        }
      ]
    },
    {
      "name": "destinationNodes",
      "source": "nodes",
      "transform": [{"type": "filter", "expr": "datum.stack == 'stk2'"}]
    },
    {
      "name": "edges",
      "source": "nodes",
      "transform": [
        {"type": "filter", "expr": "datum.stack == 'stk1'"},
        {
          "type": "lookup",
          "from": "destinationNodes",
          "key": "key",
          "fields": ["key"],
          "as": ["target"]
        },
        {
          "type": "linkpath",
          "orient": "horizontal",
          "shape": "diagonal",
          "sourceY": {"expr": "scale('y', datum.yc)"},
          "sourceX": {"expr": "scale('x', 'stk1') + bandwidth('x')"},
          "targetY": {"expr": "scale('y', datum.target.yc)"},
          "targetX": {"expr": "scale('x', 'stk2')"}
        },
        {
          "type": "formula",
          "expr": "range('y')[0]-scale('y', datum.size)",
          "as": "strokeWidth"
        },
        {
          "type": "formula",
          "expr": "datum.size/domain('y')[1]",
          "as": "percentage"
        }
      ]
    }
  ],
  "scales": [
    {
      "name": "x",
      "type": "band",
      "range": "width",
      "domain": ["stk1", "stk2"],
      "paddingOuter": 0.01,
      "paddingInner": 0.98
    },
    {
      "name": "y",
      "type": "linear",
      "range": "height",
      "domain": {"data": "nodes", "field": "y1"}
    },
    {
      "name": "color",
      "type": "ordinal",
      "range": "category",
      "domain": {"data": "rawData", "fields": ["stk1","stk2"]}
    },
    {
      "name": "stackNames",
      "type": "ordinal",
      "range": ["Client AS", "Server AS"],
      "domain": ["stk1", "stk2"]
    }
  ],
  "axes": [
    {
      "orient": "bottom",
      "scale": "x",
      "labelColor": {
        "value": "#444444"
      },
      "encode": {
        "labels": {
          "update": {
            "text": {"scale": "stackNames", "field": "value"},
            "fontSize": {"value": 14}
          }
        }
      }
    },
    {
      "orient": "left",
      "scale": "y",
      "labelColor": {
        "value": "#444444"
      },
      "encode": {
        "labels": {
          "update": {
            "text": {"signal": "format(datum.value, '.2s') + 'B'"},
            "fontSize": {"value": 12}
          }
        }
      }
    }
  ],
  "marks": [
    {
      "type": "path",
      "name": "edgeMark",
      "from": {"data": "edges"},
      "clip": true,
      "encode": {
        "update": {
          "stroke": [
            {
              "test": "groupSelector && groupSelector.stack=='stk1'",
              "scale": "color",
              "field": "stk2"
            },
            {"scale": "color", "field": "stk1"}
          ],
          "strokeWidth": {"field": "strokeWidth"},
          "path": {"field": "path"},
          "strokeOpacity": {
            "signal": "!groupSelector && (groupHover.stk1 == datum.stk1 || groupHover.stk2 == datum.stk2) ? 0.8 : 0.4"
          },
          "zindex": {
            "signal": "!groupSelector && (groupHover.stk1 == datum.stk1 || groupHover.stk2 == datum.stk2) ? 1 : 0"
          },
          "tooltip": {
            "signal": "datum.stk1 + '  ' + datum.stk2 + '    ' + format(datum.size, '.2s') + 'B (' + format(datum.percentage, '.1%') + ')'"
          }
        },
        "hover": {"strokeOpacity": {"value": 0.8}}
      }
    },
    {
      "type": "rect",
      "name": "groupMark",
      "from": {"data": "groups"},
      "encode": {
        "enter": {
          "fill": {"scale": "color", "field": "grpId"},
          "width": {"scale": "x", "band": 1}
        },
        "update": {
          "x": {"scale": "x", "field": "stack"},
          "y": {"field": "scaledY0"},
          "y2": {"field": "scaledY1"},
          "fillOpacity": {"value": 0.7},
          "tooltip": {
            "signal": "datum.grpId + '   ' + format(datum.total, '.2s') + 'B (' + format(datum.percentage, '.1%') + ')'"
          }
        },
        "hover": {"fillOpacity": {"value": 1}}
      }
    },
    {
      "type": "text",
      "from": {"data": "groups"},
      "interactive": false,
      "encode": {
        "update": {
          "x": {
            "signal": "scale('x', datum.stack) + (datum.rightLabel ? bandwidth('x') + 8 : -8)"
          },
          "yc": {"signal": "(datum.scaledY0 + datum.scaledY1)/2"},
          "align": {"signal": "datum.rightLabel ? 'left' : 'right'"},
          "baseline": {"value": "middle"},
          "fontWeight": {"value": "bold"},
          "fontSize": {"value": 12},
          "fill": {"value": "#222222"},
          "text": {
            "signal": "abs(datum.scaledY0-datum.scaledY1) > 10 ? datum.grpId : ''"
          }
        }
      }
    },
    {
      "type": "group",
      "data": [
        {
          "name": "dataForShowAll",
          "values": [{}],
          "transform": [{"type": "filter", "expr": "groupSelector"}]
        }
      ],
      "encode": {
        "enter": {
          "xc": {"signal": "width/2"},
          "y": {"value": 30},
          "width": {"value": 100},
          "height": {"value": 36}
        }
      },
      "marks": [
        {
          "type": "group",
          "name": "groupReset",
          "from": {"data": "dataForShowAll"},
          "encode": {
            "enter": {
              "cornerRadius": {"value": 3.5},
              "fill": {"value": "#666666"},
              "height": {"field": {"group": "height"}},
              "width": {"field": {"group": "width"}}
            },
            "update": {"opacity": {"value": 1}},
            "hover": {"fill": {"value": "#444444"}}
          },
          "marks": [
            {
              "type": "text",
              "interactive": false,
              "encode": {
                "enter": {
                  "xc": {"field": {"group": "width"}, "mult": 0.5},
                  "yc": {"field": {"group": "height"}, "mult": 0.5, "offset": 1},
                  "align": {"value": "center"},
                  "baseline": {"value": "middle"},
                  "text": {"value": "Show All"},
                  "fontSize": {"value": 14},
                  "stroke": {"value": "#ecf0f1"}
                }
              }
            }
          ]
        }
      ]
    }
  ],
  "signals": [
    {
      "name": "groupHover",
      "value": {},
      "on": [
        {
          "events": "@groupMark:mouseover",
          "update": "{stk1:datum.stack=='stk1' && datum.grpId, stk2:datum.stack=='stk2' && datum.grpId}"
        },
        {"events": "mouseout", "update": "{}"}
      ]
    },
    {
      "name": "groupSelector",
      "value": false,
      "on": [
        {
          "events": "@groupMark:click!",
          "update": "{stack:datum.stack, stk1:datum.stack=='stk1' && datum.grpId, stk2:datum.stack=='stk2' && datum.grpId}"
        },
        {
          "events": [
            {"type": "click", "markname": "groupReset"},
            {"type": "dblclick"}
          ],
          "update": "false"
        }
      ]
    }
  ]
}
"}}
